Ext.data.JsonP['Arrow_Cloud_1.5.5_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Arrow Cloud 1.5.5 - 5 February 2017</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-49155874\" class=\"content\">\n                        <h1>Arrow Cloud 1.5.5 - 5 February 2017</h1>\n    <p>This release of Arrow Cloud includes version     <span style=\"color: #222222;\">\n1.2.2    </span>\n of the CLI and 1.5.5 of the server, and includes one new feature.    </p>\n    <div class=\"section section-2 \" id=\"src-49155874_ArrowCloud1.5.5ReleaseNote-Newfeaturesandimprovements\">\n        <h2 class=\"heading \"><span>New features and improvements</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Added support for using multiple domains    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=49155874\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Arrow Cloud 1.5.5 Release Note"});